import React from 'react';

const HostDashboard = () => {
  return (
    <div className="container mx-auto p-8">
      <h1 className="text-4xl font-bold mb-6">Dashboard del Anfitrión</h1>
      <p>Aquí puedes gestionar tus espacios.</p>
      {/* Lista de espacios gestionables */}
    </div>
  );
};

export default HostDashboard;
